import Dropdown from 'react-bootstrap/Dropdown';

function DropdownPart(){
    return(
    <Dropdown>
      <Dropdown.Toggle variant="success" id="dropdown-basic">
        Dropdown Button
      </Dropdown.Toggle>

      <Dropdown.Menu>
        <Dropdown.Item>Probablity,Statistics and Random Processes</Dropdown.Item>
        <Dropdown.Item>Digital Systems</Dropdown.Item>
        <Dropdown.Item>Discrete Structures</Dropdown.Item>
        <Dropdown.Item>Data Structures</Dropdown.Item>
        <Dropdown.Item>Foundations of Data Science</Dropdown.Item>
        <Dropdown.Item>Object Oriented Programming</Dropdown.Item>
        <Dropdown.Item>Engineering Expoloration</Dropdown.Item>
        <Dropdown.Item>Digital Systems Laboratory</Dropdown.Item>
        <Dropdown.Item>Data Structures Laboratory</Dropdown.Item>
      </Dropdown.Menu>
    </Dropdown>
    );
}

export default DropdownPart;
